import React from 'react';
import './UserScreen.css';
import UserHome from './UserComponents/UserHome';


function UserScreen() {
  return (
    <div>
      <div className='ad-user-left'></div>
      <div className='ad-user-right'></div>
      <UserHome/>
    </div>
  )
}

export default UserScreen
